import React  from 'react';
import logo from './logo.svg';
import './App.css';
import Home from './Home';
import Navbar from './Navbar';
import { BrowserRouter, Route } from 'react-router-dom';


function App() {
  return (

    <>
    <BrowserRouter>
    <Navbar />

    <Route exact path='/' component={Home}></Route>
    </BrowserRouter>

    </>

  );
}

export default App;
